import React, { useState } from "react";

function Quetions(props) {
  const [res, setRes] = useState("");
  const [score, setScore] = useState(0);
  const ans = "eval";
  const handlechange = (event) => {
    setRes(event.target.value);
  };
  const handlenext = () => {
    if (ans === res) {
      setScore(score + 1);
      console.log(score);
    }
  };
  return (
    <div>
      <div>Which of the following is not a keyword?</div>
      <form className="options">
        <div>
          <input
            type="radio"
            id="eval"
            name="category"
            value="eval"
            onChange={handlechange}
          />
          <label for="eval">eval</label>
        </div>
        <div>
          <input
            type="radio"
            id="assert"
            name="category"
            value="assert"
            onChange={handlechange}
          />
          <label for="assert">assert</label>
        </div>
        <div>
          <input
            type="radio"
            id="nonlocal"
            name="category"
            value="nonlocal"
            onChange={handlechange}
          />
          <label for="nonlocal">nonlocal</label>
        </div>
        <div>
          <input
            type="radio"
            id="pass"
            name="category"
            value="pass"
            onChange={handlechange}
          />
          <label for="pass">pass</label>
        </div>
      </form>
      <button onClick={handlenext}>Next</button>
      {score}
      {/* <input type="radio">assert</input>
      <input type="radio">nonlocal</input>
      <input type="radio">pass</input> */}
    </div>
  );
}

export default Quetions;
